import { Scene } from '../../react/editor-context';

const ScenePane = ({ scene }: { scene: Scene | null }) => {
	console.log('scene pane', scene);
	if (!scene) {
		return (
			// <img
			// 	src="https://i.imgur.com/vWcjNCX.png"
			// 	className="rounded-lg"
			// />
			<div className="flex flex-col items-center py-12 bg-secondary-bg rounded-md">
				<h2>Empty Scene</h2>
				<p className="mt-2">No scene object to display. This is the default.</p>
			</div>
		);
	} else {
		return (
			<div
				className="select-none pointer-events-none"
				// onContextMenu={(e) => {
				// 	console.log('context');
				// 	e.preventDefault();
				// }}
			>
				<p>{JSON.stringify((scene as Scene).sceneObject)}</p>
			</div>
		);
	}
};

export default ScenePane;
